import React from "react";
import { Container } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { CssBaseline } from "@material-ui/core";
import image from "../assets/22028733.jpeg";


export default class Main extends React.Component {


  render() {
    const styles = makeStyles((theme) => ({
      root: {
        minHeight: "100vh",
        backgroundColor: "black",
        width: "100%",
        color: "white",
        display: "flex",
        flexDirection: "column",
        justifyContent: "center" /* align horizontal */,
        alignItems: "center",
        fontFamily: "Raleway",
      },
      title: {
        fontFamily: "Raleway",
      },
      container: {
        backgroundColor: "white",
        minHeight: "450px",
        minWidth: "400px",
        justifyContent: "space-between",
        display: "flex",
      },
      p: {
        color: "white",
        width: "50%",
        margin: " 100px ",
        fontSize: 21,
        textAlign:'center'
      },
      image: {
        objectFit: "fill",
        borderRadius: "210px",
      },
    }));
    const classes = styles();
    return (
      <CssBaseline>
        <div className={classes.root}>
          <img className={classes.image} src={image} alt="me"></img>
          <h1 className={classes.title}>Dario Sponchiado</h1>

          <p className={classes.p}>
            Hi.. i'm dario, i am a develop website(html, css, javascript, php,
            sql, and framework like: react, angular node and more.. ) and
            apps(react-native, flutter, xamarin) for passion, i study at
            ca-foscari university on 1Â° year,
            <br></br> I am open to work send me and email at:{" "}
            <a href="mailto:dario.sponchiado@gmail.com">
              dario.sponchiado@gmail.com
            </a>
          </p>
        </div>
      </CssBaseline>
    );
  }
}
